import TextField from '@material-ui/core/TextField';
import { createMuiTheme } from '@material-ui/core/styles';
import { Box } from '@material-ui/core';

const styleInput = {
    height: '100px',
    width: '25ch'
};
const styleBack = {
    margin: '10px',
    background: '#ccc',
    height: '300px',
    width: '30ch'

}

const Login = () =>{
    return(
        <div style = {styleBack}>
            <Box borderRadius={16}>

                <form style={styleInput}>
                    <TextField 
                        required
                        class="Input"
                        label="Email"
                        defaultValue="YourEmail@mail.com"
                        variant="outlined"
                        color="primary"
                    />
                </form>
            </Box>
        </div>
    )
}

export default Login;
